import './App.css';
import Profile from './components/content/profile/Profile';
import Header from './components/header/Header';
import Navbar from './components/navbar/Navbar';

const App = () => {
  return (
    <div className="App">
      <div className="Page">
        <Header />
        <Navbar />
        <Profile />
      </div>
    </div>
  );
}

export default App;
